function SendPacket(shutdown = false)
{
	var color;
	var packet = [];
	packet[0] = 0x04;
	packet[1] = 0x00;
	packet[2] = 0x00;
	packet[3] = 0x12;
	packet[4] = 0x38;
	packet[5] = 0x00;
	packet[6] = 0x00;
	packet[7] = 0x00;

	for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++)
	{
		var iPxX = vLedPositions[iIdx][0];
		var iPxY = vLedPositions[iIdx][1];
		if (LightingMode == "Forced")
		{
			color = hexToRgb(forcedColor);
		}
		else
		{
			color = device.color(iPxX, iPxY);
		}			
		var mxPxColor = color;
		packet[8+(iIdx*3)] = mxPxColor[0];
		packet[8+(iIdx*3)+2] = mxPxColor[2];
		packet[8+(iIdx*3)+4] = mxPxColor[1];
	}
	sendPacketString("04 01 00 01", 64);
	device.write(packet,64);
	sendPacketString("04 02 00 02", 64);
}

export function Render()
{	
	SendPacket();
	device.pause(1);
}

function sendPacketString(string, size)
{
	var packet = [];
	var data = string.split(' ');
	for(let i = 0; i < data.length; i++)
	{
		packet[i] = parseInt(data[i],16);
	}
	device.write(packet, size);
}

function hexToRgb(hex)
{
	var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	var colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);
	return colors;
}

export function Validate(endpoint)
{
	return endpoint.interface === 1 && endpoint.usage === 0x0092 && endpoint.usage_page === 0xFF1C && endpoint.collection === 4;
}

